import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丁日庚戌时断</p><p>六丁日生时庚戌，墓中逢败难成福；若无救助鬼来伤，财帛不聚伤其目。</p><p>丁日庚戌时，墓中逢败，丁以庚辛为财，戌中有丙为败，不成其福。</p><p>若无救助，叠见癸水，主伤目。</p><p>丁丑日庚戌时，时日相刑，忧伤妻子。</p><p>若寅亥申酉年月，官至三品。</p><p>午未子辰，行金木运亦贵。</p><p>丁卯日庚戌时，生亥未年月，三合会印，贵。</p><p>子月，煞印，吉。</p><p>年月建禄，僧道，主贵。</p><p>柱无救助，见癸旺，多患目疾，酉月无贵；纯酉戌年月，天干透己甲者贵，中带凶。</p><p>丁巳日庚戌时，辰巳月，金水运，风宪。</p><p>癸子、壬亥，南方运，极品。</p><p>纯未，西北运，三四品；身旺不行财官运，平常，为僧道清高。</p><p>丁未日庚戌时，主刑。</p><p>亥卯会印，申子辰会官，俱主文贵。</p><p>午月，建禄，有子冲，凶。</p><p>若年月用土生财，主富；用财生官，富贵双全。</p><p>丁酉日庚戌时，日贵格，近贵，晓艺业，有机谋。</p><p>酉戌，六害，骨肉无情，秋月，五六品贵。</p><p>丁亥日庚戌时，日贵格。</p><p>巳酉丑年月，四五品贵。</p><p>寅卯亥，火金运，位至六卿。</p><p>丁日时逢戌刻真，锁钥无匙库闭门；父母兄弟难依靠，立成家计自殷勤。</p><p>丁日时逢庚戌，火金刑害夭孤。</p><p>丑辰不遇钥匙无，库闭财能收贮。</p><p>就合托妻随住，六亲骨肉消疏。</p><p>晚年发福改门闾，此命后甜先苦。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","213卷 八·六丁日庚戌时断.html.vue"]]);export{f as default};
